import React, { useState, useEffect, useRef } from 'react';
import { Box, TextField, Button, Typography, Paper, IconButton } from '@mui/material';
import SendIcon from '@mui/icons-material/Send';
import MicIcon from '@mui/icons-material/Mic';
import { processLegalQuery } from '../services/queryService';
import { extractCitationReferences, enhanceTextWithCitations } from '../services/citationService';
import CitationDisplay from './CitationDisplay';

function Chat() {
  const [message, setMessage] = useState('');
  const [chat, setChat] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const [isRecording, setIsRecording] = useState(false);
  const chatEndRef = useRef(null);
  const mediaRecorderRef = useRef(null);
  const audioChunksRef = useRef([]);

  useEffect(() => {
    chatEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  }, [chat]);

  // Process the query without language translation for now
  const processQuery = async (text) => {
    try {
      return await processLegalQuery(text);
    } catch (error) {
      console.error("Error in process query:", error);
      throw error;
    }
  };

  const handleSend = async () => {
    if (message.trim() === '') return;
    
    // Add user message to chat
    setChat(prevChat => [...prevChat, { text: message, sender: 'user' }]);
    const userInput = message;
    setMessage('');
    setIsLoading(true);
    
    try {
      // Send to backend API
      const response = await processQuery(userInput);
      
      // Extract citation references from the response
      const citationRefs = extractCitationReferences(response);
      
      // Enhance text with citation markers
      const { enhancedText, citations } = enhanceTextWithCitations(response, citationRefs);
      
      // Add response to chat with citations
      setChat(prevChat => [...prevChat, { 
        text: enhancedText, 
        sender: 'bot',
        citations: citations
      }]);
    } catch (error) {
      console.error('Error processing message:', error);
      setChat(prevChat => [...prevChat, { 
        text: 'Sorry, I encountered an error processing your request.', 
        sender: 'bot',
        error: true
      }]);
    } finally {
      setIsLoading(false);
    }
  };
  
  // Recording functionality to be implemented later
  const startRecording = () => {
    console.log("Start recording");
    setIsRecording(true);
  };
  
  const stopRecording = () => {
    console.log("Stop recording");
    setIsRecording(false);
  };

  return (
    <Box sx={{ display: 'flex', flexDirection: 'column', height: '100%', p: 2 }}>
      {/* Chat messages display */}
      <Box sx={{ 
        display: 'flex', 
        flexDirection: 'column', 
        flexGrow: 1, 
        overflow: 'auto',
        mb: 2,
        gap: 1
      }}>
        {chat.map((msg, index) => (
          <Paper 
            key={index} 
            elevation={1} 
            sx={{ 
              p: 2,
              my: 1,
              maxWidth: '80%',
              bgcolor: msg.sender === 'user' ? 'primary.light' : 'background.paper',
              alignSelf: msg.sender === 'user' ? 'flex-end' : 'flex-start',
            }}
          >
            <Typography>{msg.text}</Typography>
            
            {msg.citations && msg.citations.length > 0 && (
              <CitationDisplay citations={msg.citations} />
            )}
          </Paper>
        ))}
        {isLoading && <Typography>Processing your request...</Typography>}
        <div ref={chatEndRef} />
      </Box>
      
      {/* Input area */}
      <Box sx={{ display: 'flex', gap: 1 }}>
        <TextField
          fullWidth
          variant="outlined"
          value={message}
          onChange={(e) => setMessage(e.target.value)}
          placeholder="Type your legal question..."
          onKeyPress={(e) => e.key === 'Enter' && handleSend()}
        />
        <IconButton 
          color={isRecording ? "secondary" : "primary"}
          onClick={isRecording ? stopRecording : startRecording}
        >
          <MicIcon />
        </IconButton>
        <Button 
          variant="contained" 
          endIcon={<SendIcon />} 
          onClick={handleSend}
          disabled={isLoading || message.trim() === ''}
        >
          Send
        </Button>
      </Box>
    </Box>
  );
}

export default Chat;
